import React, { Component } from 'react'

export default class index extends Component {
  render() {
    return (
      <ul>
        <li>
          <a href="/message1">detail1</a>&nbsp;&nbsp;
                    </li>
        <li>
          <a href="/message2">detail2</a>&nbsp;&nbsp;
                    </li>
        <li>
          <a href="/message/3">detail3</a>&nbsp;&nbsp;
                    </li>
      </ul>

    )
  }
}
